import React, { Component } from 'react';
class CloseIcon extends Component {
    render() {
        return (
            <span onClick={this.props.handleCloseMenu}>
                <div className=" bar bar--close-1"></div>
                <div className=" bar bar--close-2"></div>
            </span>
        );
    }
}

export default CloseIcon;
